import React, { useState} from 'react';
import Box from '@mui/material/Box';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import ListItemText from '@mui/material/ListItemText';
import LunchDiningIcon from '@mui/icons-material/LunchDining';
import NotificationsPausedIcon from '@mui/icons-material/NotificationsPaused';
import Button from '@mui/material/Button';


function MenuMUI2 () {

 const [anchorFood, setOpenFood] = React.useState(null);
 const [anchorSleep, setOpenSleep] = React.useState(null);

 const foodOpen = (event) => {
  setOpenFood(event.currentTarget);
};

 const sleepOpen = (event) => {
  setOpenSleep(event.currentTarget);
};

 const menuClose = () => {
    setOpenFood(null);
    setOpenSleep(null);
